INSERT INTO `tbl_aspirasi` (`id_aspirasi`, `tgl_aspirasi`, `no_ktp`, `nama`, `no_telp`, `alamat`, `aspirasi`, `lat`, `lng`, `status`, `aktif`) VALUES
('ASP20180606001', '2018-06-06 00:27:41', '3328112512700003', 'Dimyati ', '085290965719', 'Desa Gumalar RT. 012 RW. 002 Kec. Adiwerna Kab. Tegal', 'Jalan raya Gumalar -Kalipucang di depan MI Almujahidin dan SD Negeri Gumalar 02 belum ada Lampu penerangan jalan umum mhn di adakan. \r\n.trimkah', '', '', 1, 1),
('ASP20180807001', '2018-08-07 14:38:04', '3328070108820007', 'Mohammad Khasan Dardiri', '087875128032', 'Lembasari RT 5/2 kec.  Jatinegara Tegal. ', 'Jalan Jatinegara Lembasari Tamansari Wotgalih belum ada lampu PJU,  jalan sudah bagus hanya minim penerangan.  mohon diadakan Lampu PJU. \r\n\r\nsuwun', '', '', 1, 1),
('ASP20180831001', '2018-08-31 19:23:09', '3328181202670001', 'Tarsono ', '085326768181', 'Jalan serayu rt 01 rw 01 dukuhwaru tegal', 'Jalan provinsi perbatasan ksb Tegsl  dan brebes sepanjang depan desa selapura  belum terpasang lampu ada satu mati mohon ada penambahan pemasangan lsmpu jalan,  lalu lintas ramai dan rawan kecelakaan  sepanjang jalur tersrbut. Mohon perhatian instansi terkait.  Terima kasih', '', '', 1, 1),
('ASP20180831002', '2018-08-31 19:45:51', '3328181202670001', 'Tarsono ', '085326768181', 'Jalan serayu rt 01 rw 01 Selapura Dukuhwaru Tegal 52451', 'Jalan Abimanyu sepanjang Desa Selapura  belum terpasang pju ada satu mati,  mohon ada penambahan pemasangan  pju baru mengingat jalan ramai rawan kecelakaan. Mohon perhatian instansi terkait terima kasih', '-6.969597417352', '109.08910745381', 1, 1),
('ASP20181012001', '2018-10-12 18:43:02', '3328042912940005', 'Muhammad Alfian  Fernando', '085609850744', 'Banjaranyar RT 06/01, Kecamatan Balapulang,  Kabupaten Tegal 52464', 'Min, minta tolong agar jalan di desa Banjaranyar RT 06/01(dusun Dukuh Gayam), Kecamatan Balapulang, Kabupaten Tegal, dari jalan raya ke arah timur( makam sasonoloyo Beji)Sebelum Pom Bensin Banjaranyar agar dikasih penerangan. Soalnya bila malam tiba jalan gelap sekali, sebab kanan kiri hanya hamparan  sawah. \r\nBtw, lampu yang telah ada hanya ada 4 buah, itu juga di awal masuk jalannya.\r\nMinta tolong agar pihak terkait bisa memberi solusi.\r\n', '', '', 1, 1),
('ASP20181025001', '2018-10-25 11:47:36', '3328032809880002', 'Akhmad Hasanudin', '085225653537', 'Desa dukuhtengah kec.bojong kab.tegal', 'Assalamualaikum. Bpk dan Ibu yang kami hormati, Jalan raya dari desa suniarsih sampe desa tuwel di kecamatan bojong arah menuju wisata guci tolong donk di kasih lampu jalan,pertimabangan y selain jalan tersebut sebagai jalur wisata dari arah kab.pemalang jalur tersebut juga sering terjadi kecelakaan di karenakan ga ada y lampu jalan di sepanjang jalan tersebut, hanya ada beberapa yang terpasang, mohon di tindak lanjuti karena wilayah jalan tersebut persawahan . Terimakasih\r\nWassalamualaikum.....', '-7.167387553966', '109.16541131341', 1, 1),
('ASP20181228001', '2018-12-28 13:33:12', '3328140107780026', 'Nurkholis', '085226330041', 'Ds. Setu Kec. Tarub Kab. Tegal\r\nRt 03 RW 02', 'Jl. Projosumarto II tepatnya setelah gerbang desa purbasana sampai desa mindaka banyak titik titik yang belum ada PENERANGAN JALAN UMUMNYA.\r\nMohon biara tidak terlalu gelap pak...\r\nTerima kasih', '', '', 1, 1),
('ASP20190119001', '2019-01-19 12:09:13', '3328160612890003', 'Danu Ade Setiawan', '085725066646', '(KTP) Purwahamba rt14 rw06 Suradadi', 'Jalan pasar hewan Curug sampai jembatan Kaligung (termasuk di atas jembatan) masih sangat minim penerangan jalan. Sangat gelap saat malam. Mohon diberi lampu penerangan jalan.', '-6.983858072078', '109.15025402207', 1, 1),
('ASP20190505001', '2019-05-05 20:41:49', '3328071711830003', 'SURATNO', '087830365003', 'Desa Tamansari RT 03 RW 02 Kec. Jatinegara ', 'Lampu PJU di Desa Tamansari Kec. Jatinegara yang kemarin diperbaiki sejumlah 18 titik, 1 titik mati lagi. Mohon ditindak lanjuti', '', '', 1, 1),
('ASP20190703001', '2019-07-03 18:46:28', '3328102312960005', 'Chesar Yudha Pamungkas', '08979145425', 'Jl. Imam Bonjol Kudaile', 'Hampir 100% lampu lalin di Tegal (Kota dan Kabupaten) terkesan ngawur saat hijau/merah menurut saya. Mending biar lebih aman dan nyaman antar saling pengguna kendaraan bermotor di jalan raya, terutama di lampu lalu lintas dipergunakan sistem bergilir untuk masing-masing arah saat lampu menjadi hijau/merah. \r\nTidak seperti sekarang ketika lampu hijau bebarengan dari arah yg berlawanan, itu bahaya menurut saya, apalagi kalau yang dari salah satu arah mau berbelok ke kanan yang notabene akan melawan pengendara lain dari arah berlawanan yang mau lurus, seperti harus diadu jotos kalo analoginya.\r\nBerkaca dari Sleman dan seluruh DIY, disini menjadi aman ketika menerapkan sistem lampu hijau bergilir. Bahkan masing-masing jalur sampai menunggu 120 detik juga tidak menjadi masalah dan tidak terlalu menimbulkan macet panjang yg parah. Intinya, AMAN.\r\nLampu lalin juga diberi nomor hotline ke dinas terkait, jadi agar lampu lalin rusak masyarakat yg melihat bisa langsung menghubungi nomor tersebut untuk perbaikan. Tidak perlu mengisi blanko online semacam ini terlebih dahulu. Mengingat kondisi urgent bisa kapan saja terjadi di waktu yg sempit.', '', '', 1, 1),
('ASP20190804001', '2019-08-04 19:36:33', '3328141011910004', 'sam\'ani', '082313044668', 'Kesamiran. Kec tarub', 'jalan projprojosumarto2t olong di kasih lmpu pju\r\nTerutama yang gakada pemukiman / sawah.\r\nDari setu sampe mindaka dari dulu gelap terus', '', '', 1, 1),
('ASP20191018001', '2019-10-18 00:48:36', '3328152612950008', 'Chaerandi Anggian', '0895359880085', 'Ds.Jatilawang RT05/02, Kec.Kramat, Kab.Tegal', 'Jalan Projosumarto 1 tepatnya dr desa jatilawang menusi ds Wangandawa kurang penerangan, mengakibatkan pemanfaatan oleh anak muda untuk mabuk-mabukkan serta jalan yg ramai.mohon penambahan penerangannya terimakasih', '-6.896416991319', '109.17459584304', 1, 1),
('ASP20191021001', '2019-10-21 06:32:50', '3328181509930001', 'Abdu Rohman', '087700153325', 'Blubuk, dukuhwaru, tegal', 'Jlan Abimanyu,, tepat nya Jatibarang Slawi..\r\nTol pihak terkait untuk memasang lampu di sepanjang jln desa blubuk sampel desa selapura, trutama di depan gerbang desa Candra Geni di situ gelap bnget g ada PJU padahal jlanan rame,, takut Klo lewat malem.. takut ada yg isen ,, tol pasang lampu di sepanjang jln tersebut..\r\nTerimakasih', '-7.033671491516', '109.17402422778', 1, 1),
('ASP20191111001', '2019-11-11 11:18:34', '3374130502780003', 'Dedy Irawan', '081802481132', 'Santika Raya Blok M dan L', 'Mohon untuk pemasangan lampu penerangan jalan pada ruas jalan Santika Raya Blok M dan L. Terima kasih ', '-6.889059829048', '109.15759685690', 1, 1),
('ASP20191130001', '2019-11-30 00:26:50', '3328080211990004', 'Novan Qaedi Rozan', '089670782634', 'Desa Kedungbanteng RT. 001, RW. 001 Kecamatan Kedungbanteng - Kabupaten Tegal', 'Jalan Raya Kedungbanteng Tepatnya dari Polsek Kedungbanteng sampai Desa Dukuh Jati Wetan Belum tersedia lampu Jalan. mohon untuk segera di rencanakan. Terimakasih', '', '', 1, 1),
('ASP20191207001', '2019-12-07 14:58:31', '3328080211990004', 'Novan Qaedi Rozan', '089670782634', 'Desa Kedungbanteng RT. 001, RW. 001 Kecamatan Kedungbanteng - Kabupaten Tegal', 'Ruas Jalan Sentana tepatnya ruas jalan yang akan menuju ke kantor camat Kedungbanteng Kedungbanteng sampai saat ini masih belum ada penerangan jalannya.. mengingat jalan tersebut adalah jalan yang ramai untuk kiranya dapat di pasangkan lampu penerangan jalan di Ruas Jalan Sentana Kedungbanteng. Terimakasih. ', '', '', 1, 1),
('ASP20200117001', '2020-01-17 20:29:21', '3328172410960005', 'Ahmad Azzumar Al Baihaqi', '085863798024', 'Dk Wanagopa 01/03 Ds Kreman Kec Warureja Kab Tegal', 'Jalan di daerah Kec Warureja, terutama di warureja selatan, terutama di jalan kedungjati - Balamoa sangat minim penerangan jalan, sehingga banyak masyarakat yang resah jika keluar malam baik itu pulang kerja maupun kepentingan lainnya, apa lagi fi jalan desa kami yaitu jalan dukuh wanagopa, apa lagi di jalan ini pernah ada kejadian pembunuhan driver grab 1 tahun yang lalu. Dengan adanya oeristiwa tersebut banyak warga yang enggan lewat jalan tersebut jarena takut hal tersebut menimpa kepada dirinya, jadi kami mohon kepada dinas terkait untuk meninjau keluhan kami terkait penerangan jalan. Karena kami membaca dari majalah elektronik kab Tegal ada hibah 2000 lampu PJU, jadi kami sangat berharap di daerah kami bisa kebagian lampu PJU tersebut, terima kasih atas perhatian dan responnya, saya atas nama perwakilan karang taruna Ds Kreman banyak mengucapkan terima kasih ', '-6.935553243300', '109.28716253345', 1, 1),
('ASP20200203001', '2020-02-03 06:38:32', '3328143003870001', 'Akhmad Ikhwanudin', '082329343932', 'Desa Gembongdadi RT 06 RW 1 Suradadi Tegal', 'Di mohon untuk penambahan lampu jalan dari MTS. Husnaba sampai ke dk. Ladon', '', '', 1, 1),
