('ASP20200813001', '2020-08-13 20:31:33', '3328060711850002', 'Tri Nova Wijayanto', '085642573010', 'Harjosari Lor RT 18. RW. 04 Kec. Adiwerna Kab. Tegal Jawa Tengah Indonesia', 'Ruas jalan dari Lapangan Manunggal 407 ke arah barat desa harjosari lor dilanjutkan ke desa kalisoka dan desa sindang minim lampu penerangan jalan.\r\nPadahal daerah tersebut lalu lintas ramai, apalagi jalan tersebut jalan utama menuju ke makam hanggawana dan makam purbaya yang notabene sebagai salah satu pendiri kab. Tegal, banyak peziarah yang datang ke makam tersebut khususnya malam hari. Mohon untuk dinas terkait supaya merealisasikan lampu penerangan jalan umum d wilayah tersebut. ', '', '', 1, 1),
('ASP20200813002', '2020-08-13 20:33:12', '3328060711850002', 'Tri Nova Wijayanto', '085642573010', 'Harjosari Lor RT 18. RW. 04 Kec. Adiwerna Kab. Tegal Jawa Tengah Indonesia', 'Ruas jalan dari Lapangan Manunggal 407 ke arah barat desa harjosari lor dilanjutkan ke desa kalisoka dan desa sindang minim lampu penerangan jalan.\r\nPadahal daerah tersebut lalu lintas ramai, apalagi jalan tersebut jalan utama menuju ke makam hanggawana dan makam purbaya yang notabene sebagai salah satu pendiri kab. Tegal, banyak peziarah yang datang ke makam tersebut khususnya malam hari. Mohon untuk dinas terkait supaya merealisasikan lampu penerangan jalan umum d wilayah tersebut. ', '-6.948713406878', '109.12152325190', 1, 1),
('ASP20201122001', '2020-11-22 16:28:42', '3328141612820003', 'BAYU HENDRA SETIAWAN SE SH MH', '082313522828', 'JL Melati Rumah No.17 Desa Mindaka RT 003 RW 002 Kec Tarub Kab Tegal Propinsi Jawa Tengah Indonesia', 'JL Melati, Desa Mindaka Kec Tarub Kab Tegal, Lampu PJU Mati sudah 12 hari , karena lalu lintas padat sudah terjadi 2 kecelakaan lalu lintas anak terjatuh , dan saat hujan sering terdengar bunyi ledakan dan percikan api.', '', '', 1, 1),
('ASP20201130001', '2020-11-30 18:16:38', '3328022508010006', 'Wiranto', '085600260840', 'Sigedong Bumijawa kab. Tegal', 'Sepanjang jalan kecamatan Bumijawa belum ada penerangan sama sekali mohon untuk di beri lampu jalan supaya tidak gelap gulita saat malam hari', '', '', 1, 1),
