('ASP20220124001', '2022-01-24 21:03:56', '3328020406980004', 'Muhammad Fardan Auladi', '088802852386', 'Desa cempaka RT 02/01 Kec. Bumijawa Kab. Tegal', 'Penerangan di sekitar jalan Bumijawa s.d. desa Cempaka masih minim ditambah kondisi jalan juga tidak begitu halus. Tolong untuk pihak terkait untuk ditindak lanjuti', '-7.167147549435', '109.08376320629', 1, 1),
('ASP20220221001', '2022-02-21 18:23:05', '3328121306990004', 'Kodri kanamar', '089527343022', 'DS kemuning kecamatan Kramat kabupaten tegal', 'Jalan menuju arah desa kemuning kecamatan Kramat kab Tegal kalo malem kondisi disekitar tidak ada penerangan jalan itu yang menuju DS kemuning persis di gerbang desa kemuning sampai kandang sapi , mohon diberi penerangan jalan karena jalannanya dari saya kecil sampe saya sekarang rusak total ', '', '', 1, 1),
('ASP20220307001', '2022-03-07 08:44:12', '3328132010770008', 'Kusnandar', '085742209755', 'Jl singadiwangsa 11,Desa sidakaton Rt02/07, kec dukuhturi kab tegal', 'mohon di adakan Cermin Tikung di pertigaan jl singadiwangsa dan jl kauman , karna di pertigaan tersebut rawan kecelakaan', '-6.898521595663', '109.08695569547', 1, 1),
('ASP20220312001', '2022-03-12 11:15:31', '3328031608840007', 'Susilo', '0819p2792461', 'Desa gunungjati Rt 02 rw 01', 'Lampu jalan Raya Gunungjati -suniarsih pada mati buk di ganti\r\nLampu jalan Raya Gunungjati -Pucangluwuk pada mati dan penambahan titik lampu\r\nLampu jalan Raya Gunungjati - Batunyana Pada mati dan belum di ganti dan usul penambahan titik lampu', '-7.132362780387', '109.18448925018', 1, 1),
('ASP20220315001', '2022-03-15 06:35:36', '3328182004000004', 'Abi murti eka setiawan', '087878441592', 'Jl raden bagus suwanda rt 05 rw 01 desa dukuhwaru', 'Di jalan arah slawi - jatibarang, khususnya di dukuhwaru sampai ke selapura, sering terjadi tindak kejahatan, mengingat kondisi jalan yang cukup gelap dan ditengah pesawahan, juga di jalan gumayun arah pagiyanten, terutama di desa sindang, penerangan yang minim dan kondisi jalan yang berlubang sangat berbahaya apalagi kalau terjadi hujan, sudah banyak memakan korban baik kecelakaan ataupun tindak kejahatan, sebelumnya saya meminta maaf, untuk segera direaliasikan PJU dan perbaikan jalan di area yang saya sebutkan diatas. Terima kasih ', '', '', 1, 1),
('ASP20220315002', '2022-03-15 21:55:19', '3328011504900007', 'Muhammad Azzam Al Faruqi', '085870457911', 'Jatilaba Margasari Tegal', 'Mohon pemasangan lampu jalan untuk di hutan Jatilaba-pagerbarang.\r\nJalan rusak, gelap, tengah hutan.', '', '', 1, 1);
